def recursion_powersof3ton(n):
    l=[]
    
    i=0
    a=1
    
    def powers(n,i):
        if n<=0:
            return None
        a=0  
        
        a=3**i  
        if a<n:
            l.append(a)            
            i+=1
            return powers(n,i)
       
        return l
    return powers(n,i)
